.cart {
	&-container {
		&-table {
			position: relative;
			width: 100%;
			height: 500px;
			overflow: hidden scroll;
			margin-bottom: 20px;
			table {
				width: 100%;
				thead {
					background-color: $primaryColor;
					th {
						color: $textWhite;
						font-size: 14px;
					}
				}
				tbody {
					// display: inline-block;
				}
				tr {
					&:nth-child(even) {
						background-color: $secondaryBackground;
					}
					// display: block;
				}
				th,
				td {
					border: 1px solid $primaryBorderColor;
					font-size: 16px;
					font-weight: 600;
					text-align: left;
					padding: 8px 10px;
					a {
						font-size: 16px;
					}
					&:nth-child(1) {
						width: 10%;
					}
					&:nth-child(2) {
						columns: 1;
						width: 10%;
						img {
							width: 100%;
							object-fit: contain;
						}
					}
					&:nth-child(3) {
						width: 30%;
					}
					&:nth-child(4) {
						width: 15%;
					}
					&:nth-child(5) {
						width: 15%;
						.quantity {
							display: flex;
							justify-content: space-between;
							align-items: center;
							span {
								padding: 10px;
								color: $textBlack;
								border: 1px solid $textGray;
							}
							input {
								border: 1px solid $primaryBorderColor;
								outline: none;
								font-size: 14px;
								padding: 10px;
								width: 55%;
								text-align: center;
							}
						}
					}
					&:nth-child(6) {
						width: 15%;
					}
					&:last-child {
						text-align: center;
						width: 5%;
						ion-icon {
							font-size: 24px;
							&:hover {
								color: $secondaryColor;
								cursor: pointer;
							}
						}
					}
				}
			}
		}
		&-bottom {
			display: flex;
			align-items: center;
			justify-content: space-between;
			&-coupon {
				&-title {
					font-size: 20px;
					text-transform: uppercase;
					font-weight: 500;
          margin-bottom: 15px;
				}
				&-input {
					display: flex;
					justify-content: center;
					align-items: center;
					input {
						font-size: 16px;
						padding: 10px;
						border-radius: 4px;
						outline: none;
						border: 1px solid $textGray;
						margin-right: 20px;
					}
					button {
						font-size: 16px;
					}
				}
			}
			&-checkout {
        padding: 40px 60px;
        border-radius: 10px;
        background-color: $secondaryBackground;
				&-subtotal,
				&-total {
          margin-bottom: 15px;
          display: flex;
          justify-content: space-between;
          align-items: center;
          font-size: 16px;
          &-title {
            font-size: 16px;
            font-weight: 500;
          }
          &-price {
            font-size: 16px;
          }
				}
        &-total {
          &-title, &-price {
            color: $textBlue;
            font-weight: 600;
          }
        }
			}
		}
	}
}
